//Universal A(i, j, k, l, m, n, )*B(o, p, q, r, s, ) quadruple contraction
template<class A, class B, class T, class U, int Dim0, int Dim1, int Dim2, int Dim3, int Dim4, int Dim5, int Dim6, int Dim7, int Dim8, int Dim9, int Dim10, char i, char j, char k, char l, char m, char n, char o, char p, char q, char r, char s, int DimA, int DimB, int DimX, int DimY, int DimZ, int DimW, int DimV, char a, char b, char x, char y, char z, char w, char v>
class Tensor6_times_Tensor5_quadruple
{
  Tensor6_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, i, j, k, l, m, n> iterA;
  Tensor5_Expr<B, U, Dim6, Dim7, Dim8, Dim9, Dim10, o, p, q, r, s> iterB;

public:
  typename promote<T, U>::V operator()(const int N1, const int N2, const int N3) const
  {
    typename promote<T, U>::V result(0);
    for(int xx = 0; xx < DimX; ++xx)
      for(int yy = 0; yy < DimY; ++yy)
        for(int zz = 0; zz < DimZ; ++zz)
          for(int ww = 0; ww < DimW; ++ww)
            {
              // Permutation is where the indices get checked.
              result += Permutation6<DimA, DimB, DimX, DimY, DimZ, DimW, a, b, x, y, z, w>().eval(
                iterA, N1, N2, xx, yy, zz, ww) * Permutation5<DimX, DimY, DimZ, DimW, DimV, x, y, z, w, v>().eval(iterB, xx, yy, zz, ww, N3);
            }
    return result;
  }

  Tensor6_times_Tensor5_quadruple(
    const Tensor6_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, i, j, k, l, m, n> &iter_a,
    const Tensor5_Expr<B, U, Dim6, Dim7, Dim8, Dim9, Dim10, o, p, q, r, s> &iter_b)
      : iterA(iter_a), iterB(iter_b)
  {}
};

//A(i, j, k, l, m, n, )*B(l, k, j, i, o, )
template<class A, class B, class T, class U, int Dim0, int Dim1, int Dim2, int Dim3, int Dim4, int Dim5, int Dim6, char i, char j, char k, char l, char m, char n, char o>
auto operator*(const Tensor6_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, i, j, k, l, m, n> &a,
               const Tensor5_Expr<B, U, Dim3, Dim2, Dim1, Dim0, Dim6, l, k, j, i, o> &b)
{
  using TensorExpr
    = Tensor6_times_Tensor5_quadruple<A, B, T, U, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim3, Dim2, Dim1, Dim0, Dim6, i, j, k, l, m, n, l, k, j, i, o, Dim4, Dim5, Dim3, Dim2, Dim1, Dim0, Dim6, m, n, l, k, j, i, o>;
  return Tensor3_Expr<TensorExpr, typename promote<T,U>::V, Dim4, Dim5, Dim6, m, n, o>(TensorExpr(a, b));
}

